export function _ADD ( r , a , ai , aj , b , bi , bj , c , ci , cj ) {

	let C = 0 ;

	while ( --bj >= bi ) {
		const t = a[--aj] + b[bj] + C ;
		c[--cj] = t % r ;
		C = t >= r ;
	}

	while ( --aj >= ai ) {
		const t = a[aj] + C ;
		c[--cj] = t % r ;
		C = t >= r ;
	}

	if ( --cj >= ci ) c[cj] = +C ;

}

