export function _increment ( r , a , ai , aj ) {

	const _r = r - 1 ;

	while ( --aj >= ai ) {

		if ( a[aj] < _r ) {
			++a[aj] ;
			return ;
		}

		a[aj] = 0 ;

	}

}

