export function _div_limb ( r , z , a , ai , aj , q , qi ) {

	_div_limb_partial( r , 0 , z , a , ai , aj , q , qi ) ;

}

/**
 * Divides a big endian number by a single limb number.
 * Can only work with limbs of size at most sqrt( 2^53 ).
 * Allows to start with a partial quotient.
 *
 */

export function _div_limb_partial ( r , x , z , a , ai , aj , q , qi ) {

	while ( ai < aj ) {

		x *= r ; x += a[ai] ;

		q[qi] = x / z | 0 ;
		x %= z ;
		a[ai] = 0 ;

		++qi ; ++ai ;

	}

	a[aj-1] = x ;

}

/**
 * Divides a big endian number by a single limb number.
 * Can only work with limbs of size at most sqrt( 2^53 ).
 * Allows to start with a partial quotient.
 *
 * Does not update the remainder.
 */

export function _div_limb_partial_fast ( r , x , z , a , ai , aj , q , qi ) {

	while ( ai < aj ) {

		x *= r ; x += a[ai] ;

		q[qi] = x / z | 0 ;
		x %= z ;

		++qi ; ++ai ;

	}

}

/**
 * Divides a big endian number by a single limb number and returns only the
 * remainder. Can only work with limbs of size at most sqrt( 2^53 ).
 */

export function _mod_limb ( r , z , a , ai , aj ) {

	let x = 0 ;

	while ( ai < aj ) {

		x *= r ;
		x += a[ai] ;
		x %= z ;
		++ai ;

	}

	return x ;

}

