 * @param {Number} r radix
 * @param {Array} a dividend
 * @param {Number} ai
 * @param {Number} aj
 * @param {Array} b divisor (aj - ai = bj - bi + 1)
 * @param {Number} bi
 * @param {Number} bj
 * @param {Array} q quotient (length is at least qi + aj - ai)
 * @param {Number} qi
 *
